import React from "react";
import { Button, Card, CardContent, Grid, TextField } from "@mui/material";

export const Form = () => {
  return (
    <Grid container spacing={2}>
      <Grid item xs={4}></Grid>
      <h1>jjj</h1>
      <Grid item xs={4}>
        <Card>
          <CardContent>
            <h3>Sign In </h3>
            <p
              style={{ position: "relative", left: "-135px", fontWeight: 600 }}
            >
              Your E-mail
            </p>
            <TextField variant="outlined" fullWidth label="Email@example.com" />
            <p style={{ position: "relative", left: "-80px", fontWeight: 600 }}>
              Password{" "}
              <span
                style={{
                  position: "relative",
                  left: "160px",
                  color: "lightblue",
                }}
              >
                Forget Password?
              </span>
            </p>
            <TextField
              //   style={{ position: "relative", top: "80" }}
              variant="outlined"
              fullWidth
              label="Password"
            />
            <br /> <br />
            <Button variant="contained" color="success" fullWidth>
              Submit
            </Button>
          </CardContent>
        </Card>
      </Grid>
      <Grid item xs={4}></Grid>
    </Grid>
  );
};
